        protected ArmorAddonBinaryOverlay(
            MemoryPair memoryPair,
            BinaryOverlayFactoryPackage package)
            : base(
                memoryPair: memoryPair,
                package: package)
        {
            this.CustomCtor();
        }

        public static IArmorAddonGetter ArmorAddonFactory(
            OverlayStream stream,
            BinaryOverlayFactoryPackage package,
            TypedParseParams translationParams = default)
        {
            stream = Decompression.DecompressStream(stream);
            stream = ExtractRecordMemory(
                stream: stream,
                meta: package.MetaData.Constants,
                memoryPair: out var memoryPair,
                offset: out var offset,
                finalPos: out var finalPos);
            var ret = new ArmorAddonBinaryOverlay(
                memoryPair: memoryPair,
                package: package);
            ret._package.FormVersion = ret;
            ret.CustomFactoryEnd(
                stream: stream,
                finalPos: finalPos,
                offset: offset);
            ret.FillSubrecordTypes(
                majorReference: ret,
                stream: stream,
                finalPos: finalPos,
                offset: offset,
                translationParams: translationParams,
                fill: ret.FillRecordType);
            return ret;
        }

        public static IArmorAddonGetter ArmorAddonFactory(
            ReadOnlyMemorySlice<byte> slice,
            BinaryOverlayFactoryPackage package,
            TypedParseParams translationParams = default)
        {
            return ArmorAddonFactory(
                stream: new OverlayStream(slice, package),
                package: package,
                translationParams: translationParams);
        }

        public override ParseResult FillRecordType(
            OverlayStream stream,
            int finalPos,
            int offset,
            RecordType type,
            PreviousParse lastParsed,
            Dictionary<RecordType, int>? recordParseCount,
            TypedParseParams translationParams = default)
        {
            type = translationParams.ConvertToStandard(type);
            switch (type.TypeInt)
            {
                case RecordTypeInts.BOD2:
                {
                    _BodyTemplateLocation = new RangeInt32((stream.Position - offset), finalPos - offset);
                    return (int)ArmorAddon_FieldIndex.BodyTemplate;
                }
                case RecordTypeInts.RNAM:
                {
                    _RaceLocation = (stream.Position - offset);
                    return (int)ArmorAddon_FieldIndex.Race;
                }
                case RecordTypeInts.DNAM:
                {
                    _DNAMLocation = new((stream.Position - offset) + _package.MetaData.Constants.SubConstants.TypeAndLengthLength, finalPos - offset - 1);
                    return (int)ArmorAddon_FieldIndex.WeaponAdjust;
                }
                case RecordTypeInts.MOD2:
                case RecordTypeInts.MOD3:
                case RecordTypeInts.MO2C:
                case RecordTypeInts.MO3C:
                case RecordTypeInts.MO2T:
                case RecordTypeInts.MO3T:
                case RecordTypeInts.MO2S:
                case RecordTypeInts.MO3S:
                {
                    _WorldModelOverlay = GenderedItemBinaryOverlay.Factory<IModelGetter>(
                        package: _package,
                        stream: stream,
                        creator: static (s, p, r) => ModelBinaryOverlay.ModelFactory(s, p, r),
                        femaleRecordConverter: ArmorAddon_Registration.WorldModelFemaleConverter,
                        maleRecordConverter: ArmorAddon_Registration.WorldModelMaleConverter,
                        shortCircuit: false);
                    return (int)ArmorAddon_FieldIndex.WorldModel;
                }
                case RecordTypeInts.MOD4:
                case RecordTypeInts.MOD5:
                case RecordTypeInts.MO4C:
                case RecordTypeInts.MO5C:
                case RecordTypeInts.MO4T:
                case RecordTypeInts.MO5T:
                case RecordTypeInts.MO4S:
                case RecordTypeInts.MO5S:
                {
                    _FirstPersonModelOverlay = GenderedItemBinaryOverlay.Factory<IModelGetter>(
                        package: _package,
                        stream: stream,
                        creator: static (s, p, r) => ModelBinaryOverlay.ModelFactory(s, p, r),
                        femaleRecordConverter: ArmorAddon_Registration.FirstPersonModelFemaleConverter,
                        maleRecordConverter: ArmorAddon_Registration.FirstPersonModelMaleConverter,
                        shortCircuit: false);
                    return (int)ArmorAddon_FieldIndex.FirstPersonModel;
                }
                case RecordTypeInts.NAM0:
                case RecordTypeInts.NAM1:
                {
                    _SkinTextureOverlay = GenderedItemBinaryOverlay.Factory<IFormLinkNullableGetter<ITextureSetGetter>>(
                        package: _package,
                        male: RecordTypes.NAM0,
                        female: RecordTypes.NAM1,
                        stream: stream,
                        creator: static (m, p) => FormLinkBinaryTranslation.Instance.NullableOverlayFactory<ITextureSetGetter>(p, HeaderTranslation.ExtractSubrecordMemory(m, p.MetaData.Constants)),
                        fallback: FormLinkNullable<ITextureSetGetter>.Null);
                    return (int)ArmorAddon_FieldIndex.SkinTexture;
                }
                case RecordTypeInts.NAM2:
                case RecordTypeInts.NAM3:
                {
                    _TextureSwapListOverlay = GenderedItemBinaryOverlay.Factory<IFormLinkNullableGetter<IFormListGetter>>(
                        package: _package,
                        male: RecordTypes.NAM2,
                        female: RecordTypes.NAM3,
                        stream: stream,
                        creator: static (m, p) => FormLinkBinaryTranslation.Instance.NullableOverlayFactory<IFormListGetter>(p, HeaderTranslation.ExtractSubrecordMemory(m, p.MetaData.Constants)),
                        fallback: FormLinkNullable<IFormListGetter>.Null);
                    return (int)ArmorAddon_FieldIndex.TextureSwapList;
                }
                case RecordTypeInts.MODL:
                {
                    this.AdditionalRaces = BinaryOverlayList.FactoryByArray<IFormLinkGetter<IRaceGetter>>(
                        mem: stream.RemainingMemory,
                        package: _package,
                        getter: (s, p) => FormLinkBinaryTranslation.Instance.OverlayFactory<IRaceGetter>(p, s),
                        locs: ParseRecordLocations(
                            stream: stream,
                            constants: _package.MetaData.Constants.SubConstants,
                            trigger: RecordTypes.MODL,
                            skipHeader: true,
                            translationParams: translationParams));
                    return (int)ArmorAddon_FieldIndex.AdditionalRaces;
                }
                case RecordTypeInts.SNDD:
                {
                    _FootstepSoundLocation = (stream.Position - offset);
                    return (int)ArmorAddon_FieldIndex.FootstepSound;
                }
                case RecordTypeInts.ONAM:
                {
                    _ArtObjectLocation = (stream.Position - offset);
                    return (int)ArmorAddon_FieldIndex.ArtObject;
                }
                case RecordTypeInts.BSMP:
                {
                    return BoneDataParseCustomParse(
                        stream,
                        offset,
                        lastParsed: lastParsed);
                }
                default:
                    return base.FillRecordType(
                        stream: stream,
                        finalPos: finalPos,
                        offset: offset,
                        type: type,
                        lastParsed: lastParsed,
                        recordParseCount: recordParseCount,
                        translationParams: translationParams.WithNoConverter());
            }
        }
